import React from "react";
import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardFooter,
  MDBCardSubTitle,
  MDBCardText,
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBPopover,
  MDBPopoverBody,
} from "mdb-react-ui-kit";
import { Link } from "react-router-dom";
import {getZollanmeldung} from "../../Web3Client.js"
function handleVerification(){
  if(abgleichBlockchain==true){
    //event Haken erscheint
  }
}
function abgleichBlockchain(_blockchain_zid){
  getZollanmeldung(_blockchain_zid)
  .then((tx) => {
    // if(tx[0].gesamtbetrag==
    //   && tx[0].zollwert==
    //   && tx[0].lieferkosten==
    //   && tx[0].incoterms==
    //   && tx[0].exporteur==
    //   && tx[0].importeur==
    //   && tx[0].zoll==
    //   && tx[0].anmelder==
    //   && tx[1].gesamtbetrag==
    //   && tx[1].waehrung==
    //   && tx[1].exporteur==
    //   && tx[1].importeur==
    //   && tx[1].datum==
    //   && tx[1].rechnungsposten==
    //   && tx[1].lieferkosten==
    //   ){
    //     return true;
    // }
    // else{return false;}
  })
  .catch((err) => {
    console.log(err);
  });

}
function ZollDocumentTransaction(props) {
  return (
    <div>
      <MDBCard>
        <MDBCardBody>
          <MDBContainer>
            <MDBRow>
              <MDBCol>
                <MDBCardTitle>{props.description}</MDBCardTitle>
              </MDBCol>
            </MDBRow>
            <br />
          </MDBContainer>
          <MDBContainer>
            <MDBRow>
              <MDBCol>
                <MDBCardText>
                  <b>Versender</b>
                  <br />
                  {props.declarationData.exporteur.name}
                  <br />
                  {props.declarationData.exporteur.street}
                  <br />
                  {props.declarationData.exporteur.city_code} {props.declarationData.exporteur.city}, {props.declarationData.exporteur.country_code}
                </MDBCardText>
              </MDBCol>
              <MDBCol>
                <MDBCardText>
                  <b>Empfänger / Anmelder</b>
                  <br />
                  {props.declarationData.importeur.name}
                  <br />
                  {props.declarationData.importeur.street}
                  <br />
                  {props.declarationData.importeur.city_code} {props.declarationData.importeur.city}, {props.declarationData.importeur.country_code}
                </MDBCardText>
              </MDBCol>
              <MDBCol>
                <b>Anzahl Dokumente: </b>
                {props.numberDocuments}
                <br />
                <br />
                <b>Verifikation: </b>Ausstehend
                <br />
                <b>Zollbescheid: </b>Ausstehend
              </MDBCol>
            </MDBRow>
            <br />
            <MDBRow>
              <MDBCol md="8" lg="9">
                <div className="alert alert-warning" role="alert">
                  Status: {props.transaction.status}
                </div>
              </MDBCol>
              <MDBCol md="4" lg="3">
                <div className="float-end">
                  <MDBBtn onClick={() => handleVerification()} className="my-3">Daten verifizieren</MDBBtn>
                </div>
              </MDBCol>
            </MDBRow>
            <MDBRow>
              <MDBBtn
                className="mx-3 mb-3"
                color="success"
                style={{ width: 300 }}
                disabled
              >
                Anmeldung Bestätigen
              </MDBBtn>
              <MDBBtn
                color="danger"
                className="mx-3 mb-3"
                style={{ width: 300 }}
                disabled
              >
                Anmeldung Ablehnen
              </MDBBtn>
            </MDBRow>
          </MDBContainer>
          <MDBCardFooter>
            <MDBRow>
              <MDBCol md="4">Hinzugefügt: {props.dateAdded}</MDBCol>
              <MDBCol md="4">
                Zuletzt aktualisiert: {props.dateProcessed}
              </MDBCol>
            </MDBRow>
          </MDBCardFooter>
        </MDBCardBody>
      </MDBCard>
    </div>
  );
}

export default ZollDocumentTransaction;
